description:
Barely conscious and muttering to himself, Jhonen Vasquez grabbed a fishbone and scrawled on the side of a cat out a series of surrealist scripts never meant to be read by anyone. Two thousand miles away, J. Goldberg hears these very scripts whispered into her sleep by her pet ferret, devoid of any real direction beyond the dialog. Goldberg awakens to find that she has illustarted these scenes.

In Jellyfist, two artists battle with interpretation, however absurd the intent or outcome, with running commentary from the creators on just how wrong or right it&amp;#039;s all gone. The first book published as a result of ferret-aided, carved-kitten-transmitted telepathy, Jellyfist&amp;#039;s collection of highly important nonsense just might change your opinion of almost all known things. This Full color comic will have production values and bindings far beyond what the content would dictate.


